import './App.css';
import { Card } from './Card';

function App() {

  function addCard(title, content) {
    document.getElementById("card-container").append(<Card title={"Titel"} content={"Dies ist ein besonders wichtiger Inhalt"}/>)
  }

  return (
    <div>
      <div>
        <h1>React Testanwendung</h1>
        <h2>HouseTech</h2>
      </div>
      <div className="content">
        <div>
          <button onClick={addCard()}>Klick mich!</button>
        </div>
        <div id="card-container"></div>
      </div>
    </div>
  );
}

export default App;
